                'post_content' => '<h3>Playz Privacy Policy</h3>
Playz refers to Playz Holdings Pty Ltd in its own right, it\'s associated bodies, andincludes any of its subsidiaries, affiliates, officers, directors, agents, other partnersand employees, and may be referred to as, "We", "our" and "us" in this PrivacyPolicy. By using this site, you, the user of this web site, agree to the Internet PrivacyPolicy of this web site ("the web site"), which is set out on this web site page.

Playz respects your privacy and is committed to protecting your personal information.Our privacy policy outlines our approach to privacy and how we collect, use and protectyour personal information. It also sets out your rights in relation to accessing thepersonal information we collect and hold about you. We are bound by the AustralianPrivacy Principles in the Privacy Act 1988 (Cth).

We reserve the right, occasionally, to modify or remove portions of this Internet PrivacyPolicy at any time. This Privacy Policy is in addition to any other terms and conditionsapplicable to the web site. We do not make any representations about third party websites that are linked to or referenced from this web site.

We recognise the importance of protecting the privacy of information collected aboutvisitors to our web site, in particular information that is capable of identifying an
individual ("personal information"). This Privacy Policy governs the manner in whichyour personal information, obtained through the web site, will be dealt with. This PrivacyPolicy will be reviewed periodically so please check regularly so that you are updatedon any changes. We welcome your comments and feedback.
<h4>Personal Information</h4>
Personal information about visitors to our site is collected only when knowingly andvoluntarily submitted. For example, we may need to collect such information to provideyou with further services or to answer or forward any requests or enquiries. It is ourintention that this policy will protect your personal information from being dealt with inany way that is inconsistent with applicable privacy laws in Australia.
<h4>Use of Information</h4>
Personal information that visitors submit to our site is used only for the purpose forwhich it is submitted or for such other secondary purposes that are related to theprimary purpose, unless we disclose other uses in this Privacy Policy or at the time ofcollection. Copies of correspondence sent from the web site, that may contain personalinformation, are stored as archives for record-keeping and back-up purposes only.
<h4>Collecting information on Registered members</h4>
As part of registering with us, we collect and retain personal information about you inorder for you to take full advantage of our services. To do this it may be necessary foryou to provide additional information to us as detailed below.
<h4>Registration</h4>
Registration is completely optional. Registration may include submitting your name,email address, address, telephone numbers, childrens ages. By registering you are also agreeing toreceive updates and promotional material and other information. You may access thisinformation at any time by logging in and going to your account.
<h4>Disclosure</h4>
We will generally use or disclose your personal information only for the primarypurpose for which it was collected; or for a related secondary purpose where you wouldreasonably expect us to use or disclose the personal information for that secondarypurpose. We may otherwise use and disclose your personal information if you havegiven us consent for the use or disclosure or it is required or authorised by law.Apart from where you have consented or disclosure is necessary to achieve thepurpose for which it was submitted, personal information may be disclosed in specialsituations where we have reason to believe that doing so is necessary to identify,contact or bring legal action against anyone damaging, injuring, or interfering(intentionally or unintentionally) with our rights or property, users, or anyone elsewho could be harmed by such activities. We may engage contractors or other serviceproviders to provide you with goods or services on our behalf. In that circumstance,we may disclose your personal information to those third parties in order to meet yourrequest for goods or services.
<h4>Security</h4>
We strive to ensure the security, integrity and privacy of personal information submittedto this website, and we review and update our security measures in light of currenttechnologies. We will endeavour to take all reasonable steps to protect the personalinformation you may transmit to us or from our online products and services. Once wedo receive your transmission, we will also make our best efforts to ensure its securityon our systems. In addition, our employees and the contractors and service providerswho provide services related to our information systems are obliged to respect theconfidentiality of any personal information held by us. However, we will not be heldresponsible for events arising from unauthorised access to your personal information.
<h4>Collecting Information for Users</h4>
<em>IP Addresses</em>
Our web servers gather your IP address to assist with the diagnosis of problems orsupport issues with our services. Again, information is gathered in aggregate only andcannot be traced to an individual user.

<em>Cookies and Applets</em>
When you visit our Website, we use cookies to enhance and manage our website andimprove our business and the services we provide to you. By using the website andagreeing to this policy, you grant us permission to place and store cookies on yourbrowser. Cookies may be used by us to collect the following information:
<ul>
<li>your computer\'s operating system;</li>
<li>your computer\'s browser type and capabilities;</li>
<li>your computer\'s Internet Protocol (IP) address and geolocation;</li>
<li>web pages visited, including how you were referred to each web page; and</li>
<li>web page usage statistics, including the time spent on each web page. In
addition, third parties may place and read cookies on your browser, or use web
beacons or similar technologies to collect information. Cookies can be managed
by accessing the individual settings in your browser.</li>
</ul>
This aggregate, non-personal information is collated and provided to us to assist inanalysing the usage of the site and continuing to improve this website.

If you do not wish to have cookies placed on your computer, please set your browser preferences to reject all cookies before accessing our site.

<strong>Third Party Services</strong>

Playz uses a variety of services hosted by third parties, such as Google Analytics and Hotjar. These services may collect information sent by your browser as part of a web page request, such as cookies or your IP request. For information on how Google Analytics and Hotjar collect and use your information, please refer to their privacy policies. By using Playz, you consent to the processing of data by these third parties in accordance with their privacy policies.
<h4>Access to Information</h4>
We will endeavour to take all reasonable steps to keep secure any information whichwe hold about you, and to keep this information accurate and up to date. If, at any time,you discover that information held about you is incorrect, you may contact us to havethe information corrected. In addition, our employees and the contractors and serviceproviders who provide services related to our information systems are obliged to respectthe confidentiality of any personal information held by us.
<h4>Using your personal Information</h4>
Generally, we use and disclose your personal information for the purpose of providingyou with the services that you have requested, or otherwise to enable us to carry outour business. If those purposes for which we have collected the information involveproviding personal information about an individual to any third party, we will take
appropriate and reasonable steps to ensure any personal information is protected.We will generally only use personal information for marketing if you have given express
or implied consent or it is impracticable to seek consent before this use.When registering with Playz, you consent to Playz using your personal information,such as your email address, for direct marketing purposes. This includes sending youemails on relevant activities for your children. You may opt out of receiving these directmarketing communications at any time. Our electronic marketing activities will complywith the requirements of the Spam Act 2003 (Cth).
<h4>Links to other sites</h4>
We provide links to Web sites outside of this web site, which are owned and managedby third parties. These linked sites are not under our control, and we cannot acceptresponsibility for the conduct of companies linked to our website. Before disclosing yourpersonal information on any other website, we advise you to examine the terms andconditions of using that Web site and its privacy statement.
<h4>Problems or questions</h4>
If we become aware of any ongoing concerns or problems with our web site, we willtake these issues seriously and work to address these concerns. If you have any furtherqueries relating to our Privacy Policy, or you have a problem or complaint, pleasecontact us at info@playz.com.au. For more information about privacy issues in Australiaand protecting your privacy, visit the Australian Federal Privacy Commissioner\'s website; www.privacy.gov.au
Privacy Policy last updated on May 2015.',
