to this website, and we review and update our security measures in light of current
technologies. We will endeavour to take all reasonable steps to protect the personal
information you may transmit to us or from our online products and services. Once we
do receive your transmission, we will also make our best efforts to ensure its security
on our systems. In addition, our employees and the contractors and service providers
who provide services related to our information systems are obliged to respect the
confidentiality of any personal information held by us. However, we will not be held
responsible for events arising from unauthorised access to your personal information.
Collecting Information for Users
<em>IP Addresses</em>
Our web servers gather your IP address to assist with the diagnosis of problems or
support issues with our services. Again, information is gathered in aggregate only and
cannot be traced to an individual user.
<em>Cookies and Applets</em>
When you visit our Website, we use cookies to enhance and manage our website and
improve our business and the services we provide to you. By using the website and
agreeing to this policy, you grant us permission to place and store cookies on your
browser. Cookies may be used by us to collect the following information:
<ul>
<li>your computer\'s operating system;</li>
<li>your computer\'s browser type and capabilities;</li>
<li>your computer\'s Internet Protocol (IP) address and geolocation;</li>
<li>web pages visited, including how you were referred to each web page; and</li>
<li>web page usage statistics, including the time spent on each web page. In
addition, third parties may place and read cookies on your browser, or use web
beacons or similar technologies to collect information. Cookies can be managed
by accessing the individual settings in your browser.</li>
</ul>
