30. Playz may vary these terms and conditions at any time. Any changes become effective on posting. By continuing to use the Site after the terms and conditions have been updated you agree to be bound by these updates.

31. Any person using this Site may report any alleged violation of the Site\'s Terms and Conditions to Playz by using the following email info@playz.com.au. Playz will investigate any such claim and take any actions we deem appropriate at our sole discretion.',
