                'post_date_gmt' => '2015-02-09 21:32:57',
                'post_content' => '<h3>Reviews are for the benefit of other users who may wish to use the same activities that you have used.</h3>
&nbsp;
<h3>Who can Post a review on playz</h3>
<ul>
<li>any registered user whose child has attended the activity being reviewed</li>
<li>and the registered user has no affiliation with the activity provider of the listing</li>
</ul>
&nbsp;
<h3>The intention of reviews</h3>
<ul>
<li>to provide information to other users looking at activities</li>
<li>to give a personal account of a users experience</li>
</ul>
&nbsp;
<h3>Are reviews moderated?</h3>
<ul>
<li>The playz team reads every review and posts only reviews that meet our guidelines.</li>
<li>Activity Providers are able to have a right of reply / comment to every review posted.</li>
<li>Activity Providers are able to request reviews to be removed from playz if they can verify the review is not written in good faith.</li>
</ul>
&nbsp;
<h3>What\'s not allowed?</h3>
<h4>  1.Objectionable material:</h4>
<ul>
<li>Obscene or distasteful content</li>
<li>Profanity or spiteful remarks</li>
<li>Promotion of illegal or immoral conduct</li>
</ul>
&nbsp;
<h4>  2. Promotional content:</h4>
<ul>
<li>Reviews written for any form of compensation.</li>
</ul>
&nbsp;
<h4>  3. Inappropriate content:</h4>
<ul>
<li>Other people\'s material (this includes excessive quoting)</li>
<li>Phone numbers, mailing addresses, and URLs external to playz</li>
</ul>
&nbsp;
<h4>  4Off-topic information:</h4>
<ul>
<li>reviews should be relevant to the activity being reviewed</li>
</ul>
&nbsp;
<h3>Only first hand experiences</h3>
<ul>
<li>No second-hand information or hearsay (unverified information, rumors, or quotations from other sources or the reported opinions/experience of others).</li>
<li>No reviews written by ownership, management or other representative of the providers business including representatives from other locations or areas.</li>
<li>Individuals affiliated with a provider may not review competitors.</li>
<li>No ratings or comments about aspects of an activity that your children did not experience.</li>
</ul>
&nbsp;',
